import React from 'react';
import '../App.css';

var datetime = () => {
    var showdate = new Date();
    var displaytodaysdate=showdate.toDateString();
    return(
        <div className='date'>
            <input type='text' value={displaytodaysdate} readOnly='true' />
        </div>
    );
}



export default datetime;
